*{
    box-sizing: border-box;
}
body{
    background: rgb(50, 164, 205);
}
.clearfix{
    content: "";
    display: block;
    clear: both;
}
.face-1{
    margin: 50px auto;
    position: relative;
    width: 420px;
    height: 400px;
    background-color: #1e90ff;
    border: 2px solid #000;
    border-radius: 47% 47% 45% 45%;
}
.face-2{
    position: absolute;
    bottom: 0;
    left: 30px;
    width: 360px;
    height: 300px;
    background-color: #fff;
    border: 2px solid #000;
    border-radius: 50% 50% 45% 45%;
}
.eye-box{
    position: absolute;
    top: -45px;
    right: 90px;
    width: 180px;
    height: auto;
}
.big-eye-left,.big-eye-right{
    width: 90px;
    height: 110px;
    background-color: #fff;
    border: 2px solid #000;
    border-radius: 46%;
}
.big-eye-left{
    float: left;
}
.big-eye-right{
    float: right;
}
.small-eye-left,.small-eye-right{
    position: absolute;
    top: 50px;
    width: 27px;
    height: 27px;
    background-color: #000;
    border-radius: 50%;
}
.small-eye-left{
    left: 60px;
}
.small-eye-right{
    right: 60px;
}
.nose-1{
    position: absolute;
    top: 47px;
    left: 150px;
    width: 50px;
    height: 50px;
    background-color: #ff0000;
    border: 2px solid #000;
    border-radius: 50%;
}
.nose-1-shadow{
    position: absolute;
    top: 10px;
    left: 25px;
    width: 15px;
    height: 15px;
    background-color: #fff;
    border-radius: 50%;
    box-shadow: 0px 0px 2px 2px rgba(255,255,255,4);
}
.nose-2{
    height: 130px;
    width: 2px;
    position: absolute;
    top: 95px;
    left: 170px;
    border-left: 2px solid #000;
}
.mouth{
    position: absolute;
    top: 25px;
    left: 60px;
    height: 200px;
    width: 240px;
    border-bottom: 2px solid #000;
    border-radius: 0 0 45% 45%;
}
.whisker-left,
.whisker-right {
	position: absolute;
	top: 60px;
	width: 180px;
	height: 180px;
}

.whisker-left {
	left: 0;
}

.whisker-right {
	right: 0;
}

.whisker-left span:nth-child(1),
.whisker-right span:nth-child(1) {
	position: absolute;
	top: 30px;
	height: 60px;
	width: 100px;
	border-top: 2px solid #000;
}

.whisker-left span:nth-child(1) {
	left: 30px;
	-webkit-transform: rotate(20deg);
	transform: rotate(20deg);
}

.whisker-right span:nth-child(1) {
	right: 30px;
	-webkit-transform: rotate(-20deg);
	transform: rotate(-20deg);
}

.whisker-left span:nth-child(2),
.whisker-right span:nth-child(2) {
	position: absolute;
	top: 60px;
	height: 60px;
	width: 100px;
	border-top: 2px solid #000;
}

.whisker-left span:nth-child(2) {
	left: 35px;
}

.whisker-right span:nth-child(2) {
	right: 35px;
}

.whisker-left span:nth-child(3),
.whisker-right span:nth-child(3) {
	position: absolute;
	top: 90px;
	height: 60px;
	width: 100px;
	border-top: 2px solid #000;
}

.whisker-left span:nth-child(3) {
	left: 50px;
	-webkit-transform: rotate(-20deg);
	transform: rotate(-20deg);
}

.whisker-right span:nth-child(3) {
	right: 50px;
	-webkit-transform: rotate(20deg);
	transform: rotate(20deg);
}
.collar {
	position: absolute;
	top: 350px;
	left: 50px;
	width: 320px;
	height: 50px;
	background-color: #FF0000;
	border: 2px solid #000;
	border-radius: 30px;
}
