}
@keyframes wave{
    0%{
      transform: rotate(0deg);
    }
    33%{
        transform: rotate(50deg);
    }
    66%{
        transform: rotate(-50deg);
    }
    100%{
        transform: rotate(0deg);
    }
}
.face-1:hover{
    animation: wave 1s infinite linear;
}
